function displayTransportTable(destination) {
    var table = document.getElementById('transportTable');
    table.innerHTML = '';  // Vider le tableau avant de le remplir

    // Définir la taille du texte dans une variable
    var fontSize = '8px';

    // Ajouter un en-tête au tableau
    var headerRow = table.insertRow();
    var originHeader = headerRow.insertCell(0);
    var destinationHeader = headerRow.insertCell(1);
    var quantityHeader = headerRow.insertCell(2);
    var distanceHeader = headerRow.insertCell(3);

    originHeader.innerHTML = '<b>Origine</b>';
    destinationHeader.innerHTML = '<b>Destination</b>';
    quantityHeader.innerHTML = '<b>Quantité</b>';
    distanceHeader.innerHTML = '<b>Distance (km)</b>';

    // Appliquer la taille de police et les bordures aux en-têtes
    [originHeader, destinationHeader, quantityHeader, distanceHeader].forEach(function(headerCell) {
    headerCell.style.fontSize = fontSize;
    headerCell.style.border = '1px solid gray'; // Ajouter un bord gris aux en-têtes
    });

    var filteredData = data.filter(function(d) {
        return d['DESTINATION'] === destination;
    });

    var totalQuantity = 0;

    // Ajouter les lignes au tableau pour chaque transport
    filteredData.forEach(function(d) {
        var row = table.insertRow();
        var originCell = row.insertCell(0);
        var destinationCell = row.insertCell(1);
        var quantityCell = row.insertCell(2);
        var distanceCell = row.insertCell(3);

        // Ajouter du texte
        originCell.textContent = d['ORIGINE'];
        destinationCell.textContent = d['DESTINATION'];
        quantityCell.textContent = d['QUANTITE'] + ' ' + d['UNITE'];
        distanceCell.textContent = d['Distance_km'].toFixed(2);

        // Appliquer la taille de police aux cellules de données
        [originCell, destinationCell, quantityCell, distanceCell].forEach(function(cell) {
            cell.style.fontSize = fontSize;
        });

        totalQuantity += parseFloat(d['QUANTITE']);  // Ajouter à la quantité totale
    });

    // Ajouter une ligne pour le total des quantités
    var totalRow = table.insertRow();
    var totalLabelCell = totalRow.insertCell(0);
    totalLabelCell.colSpan = 2;
    totalLabelCell.innerHTML = '<b>Total</b>';
    var totalQuantityCell = totalRow.insertCell(1);
    totalQuantityCell.innerHTML = '<b>' + totalQuantity.toFixed(2) + ' m³ ou t</b>';
    
    // Appliquer la taille de police au total
    [totalLabelCell, totalQuantityCell].forEach(function(cell) {
        cell.style.fontSize = fontSize;
    });
    }

// Fonction pour ajouter des événements de clic sur chaque case à cocher
function addClickEvents() {
    var checkboxes = document.querySelectorAll('.leaflet-control-layers-selector');
    checkboxes.forEach(function(checkbox) {
        checkbox.addEventListener('change', function() {
            var label = this.nextSibling.innerText.trim();  // Récupérer le nom de la destination associée
            if (this.checked) {
                displayTransportTable(label);  // Afficher le tableau si la case est cochée
            } else {
                document.getElementById('transportTable').innerHTML = '';  // Vider le tableau si la case est décochée
            }
        });
        
        // Modifier la taille du texte de l'étiquette associée
        if (checkbox.nextSibling) {
            checkbox.nextSibling.style.fontSize = '8px';
        }
    });
}

    // Appeler la fonction pour ajouter les événements après le chargement des calques
    window.onload = function() {
        setTimeout(addClickEvents, 1000);  // Ajouter un délai pour que tous les calques soient bien chargés
    };
